private java.util.List<? extends java.lang.Object> setElementInConsList(java.util.List<java.util.Collection<? extends java.lang.Object>> chain, java.util.Collection<? extends java.lang.Object> current, java.lang.Object oldO, java.lang.Object newO) {
    java.util.List<? extends java.lang.Object> oldL = ((java.util.List<? extends java.lang.Object>) (current));
    java.util.List<? extends java.lang.Object> newL = this.replaceInConsList(oldL, oldO, newO);
    if (chain.isEmpty()) {
