    }
    java.util.List<java.util.Collection<? extends java.lang.Object>> reducedChain = new java.util.ArrayList<java.util.Collection<? extends java.lang.Object>>(chain);
    java.util.Collection<? extends java.lang.Object> newCurrent = reducedChain.remove(reducedChain.size() - 1);
