public boolean process(java.util.Set<? extends javax.lang.model.element.TypeElement> annotations, javax.annotation.processing.RoundEnvironment roundEnv) {
    if (this.processingEnv == null) {
        return false;
    }
    java.util.IdentityHashMap<com.sun.tools.javac.tree.JCTree.JCCompilationUnit, java.lang.Void> units = new java.util.IdentityHashMap<com.sun.tools.javac.tree.JCTree.JCCompilationUnit, java.lang.Void>();
    for (javax.lang.model.element.Element element : roundEnv.getRootElements()) {
        com.sun.tools.javac.tree.JCTree.JCCompilationUnit unit = this.toUnit(element);
        if (unit != null) {
            units.put(unit, null);
        }
    }
    java.util.List<lombok.javac.JavacAST> asts = new java.util.ArrayList<lombok.javac.JavacAST>();
    for (com.sun.tools.javac.tree.JCTree.JCCompilationUnit unit : units.keySet()) {
        asts.add(new lombok.javac.JavacAST(this.trees, this.processingEnv.getMessager(), this.processingEnv.getContext(), unit));
    }
    this.handlers.skipPrintAST();
    for (lombok.javac.JavacAST ast : asts) {
        ast.traverse(new lombok.javac.apt.Processor.AnnotationVisitor());
        this.handlers.callASTVisitors(ast);
    }
    this.handlers.skipAllButPrintAST();
    for (lombok.javac.JavacAST ast : asts) {
        ast.traverse(new lombok.javac.apt.Processor.AnnotationVisitor());
    }
    return false;
}

