/**
 * Returns the method that's already been generated by lombok with the given name.
 * Provide any node that represents the type (TypeDeclaration) to look in, or any child node thereof.
 */
public static lombok.eclipse.EclipseNode getExistingLombokMethod(java.lang.String methodName, lombok.eclipse.EclipseNode node) {
    while ((node != null) && (!(node.get() instanceof org.eclipse.jdt.internal.compiler.ast.TypeDeclaration))) {
        node = node.up();
    } 
    if (node == null) {
        return null;
    }
    if (node.get() instanceof org.eclipse.jdt.internal.compiler.ast.TypeDeclaration) {
        for (org.eclipse.jdt.internal.compiler.ast.AbstractMethodDeclaration def : ((org.eclipse.jdt.internal.compiler.ast.TypeDeclaration) (node.get())).methods) {
            char[] mName = def.selector;
            if (mName == null) {
                continue;
            }
            if (methodName.equals(new java.lang.String(mName))) {
                lombok.eclipse.EclipseNode existing = node.getNodeFor(def);
                if (existing.isHandled()) {
                    return existing;
                }
            }
        }
    }
    return null;
}

