/**
 * Finds type matches for the stated type reference. The provided context is scanned for local type names
 * that shadow type names listed in import statements. If such a shadowing occurs, no matches are returned
 * for any shadowed types, as you would expect.
 */
public java.util.Collection<java.lang.String> findTypeMatches(lombok.core.LombokNode<? extends java.lang.Object, ? extends java.lang.Object, ? extends java.lang.Object> context, java.lang.String typeRef) {
    java.util.Collection<java.lang.String> potentialMatches = this.library.findCompatible(typeRef);
    if (potentialMatches.isEmpty()) {
        return java.util.Collections.emptyList();
    }
    int idx = typeRef.indexOf('.');
    if (idx > (-1)) {
        return potentialMatches;
    }
    java.lang.String simpleName = typeRef.substring(idx + 1);
    // If there's an import statement that explicitly imports a 'Getter' that isn't any of our potentials, return no matches.
    if (this.nameConflictInImportList(simpleName, potentialMatches)) {
        return java.util.Collections.emptyList();
    }
    // Check if any of our potentials is even imported in the first place. If not: no matches.
    potentialMatches = this.eliminateImpossibleMatches(potentialMatches);
    if (potentialMatches.isEmpty()) {
        return java.util.Collections.emptyList();
    }
    // Find a lexically accessible type of the same simple name in the same Compilation Unit. If it exists: no matches.
    lombok.core.LombokNode<? extends java.lang.Object, ? extends java.lang.Object, ? extends java.lang.Object> n = context;
    while (n != null) {
        if (n.getKind() == lombok.core.AST.Kind.TYPE) {
            java.lang.String name = n.getName();
            if ((name != null) && name.equals(simpleName)) {
                return java.util.Collections.emptyList();
            }
        }
        n = n.up();
    } 
    // The potential matches we found by comparing the import statements is our matching set. Return it.
    return potentialMatches;
}

