private org.eclipse.jdt.internal.compiler.ast.Expression longToIntForHashCode(org.eclipse.jdt.internal.compiler.ast.Reference ref1, org.eclipse.jdt.internal.compiler.ast.Reference ref2, org.eclipse.jdt.internal.compiler.ast.ASTNode source) {
    int pS = source.sourceStart;
    int pE = source.sourceEnd;
    /* (int)(ref >>> 32 ^ ref) */
    org.eclipse.jdt.internal.compiler.ast.IntLiteral int32 = new org.eclipse.jdt.internal.compiler.ast.IntLiteral("32".toCharArray(), pS, pE);
    lombok.eclipse.Eclipse.setGeneratedBy(int32, source);
    org.eclipse.jdt.internal.compiler.ast.BinaryExpression higherBits = new org.eclipse.jdt.internal.compiler.ast.BinaryExpression(ref1, int32, org.eclipse.jdt.internal.compiler.ast.OperatorIds.UNSIGNED_RIGHT_SHIFT);
    lombok.eclipse.Eclipse.setGeneratedBy(higherBits, source);
    org.eclipse.jdt.internal.compiler.ast.BinaryExpression xorParts = new org.eclipse.jdt.internal.compiler.ast.BinaryExpression(ref2, higherBits, org.eclipse.jdt.internal.compiler.ast.OperatorIds.XOR);
    lombok.eclipse.Eclipse.setGeneratedBy(xorParts, source);
    org.eclipse.jdt.internal.compiler.ast.TypeReference intRef = org.eclipse.jdt.internal.compiler.ast.TypeReference.baseTypeReference(org.eclipse.jdt.internal.compiler.lookup.TypeIds.T_int, 0);
    intRef.sourceStart = pS;
    intRef.sourceEnd = pE;
    lombok.eclipse.Eclipse.setGeneratedBy(intRef, source);
    org.eclipse.jdt.internal.compiler.ast.CastExpression expr = new org.eclipse.jdt.internal.compiler.ast.CastExpression(xorParts, intRef);
    expr.sourceStart = pS;
    expr.sourceEnd = pE;
    lombok.eclipse.Eclipse.setGeneratedBy(expr, source);
    return expr;
}

