private void doAssignmentCheck0(lombok.eclipse.EclipseNode node, org.eclipse.jdt.internal.compiler.ast.Statement statement, char[] varName) {
    if (statement instanceof org.eclipse.jdt.internal.compiler.ast.Assignment) {
        this.doAssignmentCheck0(node, ((org.eclipse.jdt.internal.compiler.ast.Assignment) (statement)).expression, varName);
    } else if (statement instanceof org.eclipse.jdt.internal.compiler.ast.LocalDeclaration) {
        this.doAssignmentCheck0(node, ((org.eclipse.jdt.internal.compiler.ast.LocalDeclaration) (statement)).initialization, varName);
    } else if (statement instanceof org.eclipse.jdt.internal.compiler.ast.CastExpression) {
        this.doAssignmentCheck0(node, ((org.eclipse.jdt.internal.compiler.ast.CastExpression) (statement)).expression, varName);
    } else if (statement instanceof org.eclipse.jdt.internal.compiler.ast.SingleNameReference) {
        if (java.util.Arrays.equals(((org.eclipse.jdt.internal.compiler.ast.SingleNameReference) (statement)).token, varName)) {
            lombok.eclipse.EclipseNode problemNode = node.getNodeFor(statement);
            if (problemNode != null) {
                problemNode.addWarning("You're assigning an auto-cleanup variable to something else. This is a bad idea.");
            }
        }
    }
}

