private static void loadWindowsDriveInfoLib() throws java.io.IOException {
    if (!lombok.installer.EclipseFinder.windowsDriveInfoLibLoaded.compareAndSet(false, true)) {
        return;
    }
    final java.lang.String prefix = ("lombok-" + lombok.core.Version.getVersion()) + "-";
    java.io.File temp = java.io.File.createTempFile("lombok", ".mark");
    java.io.File dll1 = new java.io.File(temp.getParentFile(), prefix + "WindowsDriveInfo-i386.dll");
    java.io.File dll2 = new java.io.File(temp.getParentFile(), prefix + "WindowsDriveInfo-x86_64.dll");
    temp.delete();
    dll1.deleteOnExit();
    dll2.deleteOnExit();
    try {
        if (lombok.installer.EclipseFinder.unpackDLL("WindowsDriveInfo-i386.dll", dll1)) {
            java.lang.System.load(dll1.getAbsolutePath());
            return;
        }
    } catch (java.lang.Throwable ignore) {
    }
    try {
        if (lombok.installer.EclipseFinder.unpackDLL("WindowsDriveInfo-x86_64.dll", dll2)) {
            java.lang.System.load(dll2.getAbsolutePath());
        }
    } catch (java.lang.Throwable ignore) {
    }
}

private java.util.List<? extends java.lang.Object> replaceInConsList(java.util.List<? extends java.lang.Object> oldL, java.lang.Object oldO, java.lang.Object newO) {
    boolean repl = false;
    java.lang.Object[] a = oldL.toArray();
    for (int i = 0; i < a.length; i++) {
        if (a[i] == oldO) {
            a[i] = newO;
            repl = true;
        }
    }
    if (repl) {
        return java.util.List.<java.lang.Object>from(a);
    }
    return oldL;
}

