public static void main(java.lang.String[] args) {
    if ((args.length > 0) && args[0].equals("install")) {
        if ((args.length < 3) || (!args[1].equals("eclipse"))) {
            java.lang.System.err.println("Run java -jar lombok.jar install eclipse path/to/eclipse/executable");
            java.lang.System.exit(1);
        }
        java.lang.String path = args[2];
        try {
            lombok.installer.EclipseLocation loc = lombok.installer.EclipseLocation.create(path);
            loc.install();
            java.lang.System.out.println("Installed to: " + loc.getName());
            java.lang.System.exit(0);
        } catch (lombok.installer.EclipseLocation.NotAnEclipseException e) {
            java.lang.System.err.println("Not a valid eclipse location:");
            java.lang.System.err.println(e.getMessage());
            java.lang.System.exit(2);
        } catch (lombok.installer.EclipseLocation.InstallException e) {
            java.lang.System.err.println("Installation failed:");
            java.lang.System.err.println(e.getMessage());
            java.lang.System.exit(1);
        }
    }
    if ((args.length > 0) && args[0].equals("uninstall")) {
        if ((args.length < 3) || (!args[1].equals("eclipse"))) {
            java.lang.System.err.println("Run java -jar lombok.jar uninstall eclipse path/to/eclipse/executable");
            java.lang.System.exit(1);
        }
        java.lang.String path = args[2];
        try {
            lombok.installer.EclipseLocation loc = lombok.installer.EclipseLocation.create(path);
            loc.uninstall();
            java.lang.System.out.println("Uninstalled from: " + loc.getName());
            java.lang.System.exit(0);
        } catch (lombok.installer.EclipseLocation.NotAnEclipseException e) {
            java.lang.System.err.println("Not a valid eclipse location:");
            java.lang.System.err.println(e.getMessage());
            java.lang.System.exit(2);
        } catch (lombok.installer.EclipseLocation.UninstallException e) {
            java.lang.System.err.println("Uninstall failed:");
            java.lang.System.err.println(e.getMessage());
            java.lang.System.exit(1);
        }
    }
    if (lombok.installer.EclipseFinder.getOS() == lombok.installer.EclipseFinder.OS.MAC_OS_X) {
        java.lang.System.setProperty("com.apple.mrj.application.apple.menu.about.name", "Lombok Installer");
        java.lang.System.setProperty("com.apple.macos.use-file-dialog-packages", "true");
    }
    try {
        javax.swing.SwingUtilities.invokeLater(new java.lang.Runnable() {
            1() {
                super();
            }

            public void run() {
                try {
                    try {
                        javax.swing.UIManager.setLookAndFeel(javax.swing.UIManager.getSystemLookAndFeelClassName());
                    } catch (java.lang.Exception ignore) {
                    }
                    new lombok.installer.Installer().show();
                } catch (java.awt.HeadlessException e) {
                    lombok.installer.Installer.printHeadlessInfo();
                }
            }
        });
    } catch (java.awt.HeadlessException e) {
        lombok.installer.Installer.printHeadlessInfo();
    }
}

