private boolean createGetterForField(lombok.AccessLevel level, lombok.eclipse.EclipseNode fieldNode, lombok.eclipse.EclipseNode errorNode, org.eclipse.jdt.internal.compiler.ast.ASTNode source, boolean whineIfExists) {
    if (fieldNode.getKind() != lombok.core.AST.Kind.FIELD) {
        errorNode.addError("@Getter is only supported on a field.");
        return true;
    }
    org.eclipse.jdt.internal.compiler.ast.FieldDeclaration field = ((org.eclipse.jdt.internal.compiler.ast.FieldDeclaration) (fieldNode.get()));
    org.eclipse.jdt.internal.compiler.ast.TypeReference fieldType = lombok.eclipse.Eclipse.copyType(field.type, source);
    java.lang.String fieldName = new java.lang.String(field.name);
    boolean isBoolean = lombok.eclipse.handlers.EclipseHandlerUtil.nameEquals(fieldType.getTypeName(), "boolean") && (fieldType.dimensions() == 0);
    java.lang.String getterName = lombok.core.TransformationsUtil.toGetterName(fieldName, isBoolean);
    int modifier = lombok.eclipse.handlers.EclipseHandlerUtil.toEclipseModifier(level) | (field.modifiers & org.eclipse.jdt.internal.compiler.classfmt.ClassFileConstants.AccStatic);
    for (java.lang.String altName : lombok.core.TransformationsUtil.toAllGetterNames(fieldName, isBoolean)) {
        switch (lombok.eclipse.handlers.EclipseHandlerUtil.methodExists(altName, fieldNode)) {
            case EXISTS_BY_LOMBOK :
                return true;
            case EXISTS_BY_USER :
                if (whineIfExists) {
                    java.lang.String altNameExpl = "";
                    if (!altName.equals(getterName)) {
                        altNameExpl = java.lang.String.format(" (%s)", altName);
                    }
                    errorNode.addWarning(java.lang.String.format("Not generating %s(): A method with that name already exists%s", getterName, altNameExpl));
                }
                return true;
            default :
            case NOT_EXISTS :
                // continue scanning the other alt names.
        }
    }
    org.eclipse.jdt.internal.compiler.ast.MethodDeclaration method = this.generateGetter(((org.eclipse.jdt.internal.compiler.ast.TypeDeclaration) (fieldNode.up().get())), field, getterName, modifier, source);
    org.eclipse.jdt.internal.compiler.ast.Annotation[] copiedAnnotations = lombok.eclipse.Eclipse.copyAnnotations(lombok.eclipse.handlers.EclipseHandlerUtil.findAnnotations(field, lombok.core.TransformationsUtil.NON_NULL_PATTERN), lombok.eclipse.handlers.EclipseHandlerUtil.findAnnotations(field, lombok.core.TransformationsUtil.NULLABLE_PATTERN), source);
    if (copiedAnnotations.length != 0) {
        method.annotations = copiedAnnotations;
    }
    lombok.eclipse.handlers.EclipseHandlerUtil.injectMethod(fieldNode.up(), method);
    return true;
}

