 */
private static void findEclipseOnMac(java.util.List<lombok.installer.EclipseLocation> locations, java.util.List<lombok.installer.EclipseLocation.NotAnEclipseException> problems) {
    for (java.io.File dir : new java.io.File("/Applications").listFiles()) {
        if (!dir.isDirectory()) {
            continue;
        }
        if (dir.getName().toLowerCase().equals("eclipse.app")) {
            // This would be kind of an unorthodox Eclipse installation, but if Eclipse ever
            // moves to this more maclike installation concept, our installer can still handle it.
            try {
                locations.add(lombok.installer.EclipseLocation.create("/Applications"));
            } catch (lombok.installer.EclipseLocation.NotAnEclipseException e) {
                problems.add(e);
            }
        }
        if (dir.getName().toLowerCase().contains("eclipse")) {
            if (new java.io.File(dir, "Eclipse.app").exists()) {
                try {
                    locations.add(lombok.installer.EclipseLocation.create(dir.toString()));
                } catch (lombok.installer.EclipseLocation.NotAnEclipseException e) {
                    problems.add(e);
                }
            }
        }
    }
}

