private static lombok.installer.EclipseLocation findEclipseIniFromExe(java.io.File exePath, int loopCounter) throws lombok.installer.EclipseLocation.NotAnEclipseException {
    java.lang.System.out.println(exePath);
    {
        java.io.File ini = new java.io.File(exePath.getParentFile(), "eclipse.ini");
        if (ini.isFile()) {
            return new lombok.installer.EclipseLocation(lombok.installer.EclipseLocation.getFilePath(exePath), ini);
        }
    }
    {
        java.io.File ini = new java.io.File(exePath.getParentFile(), "Eclipse.app/Contents/MacOS/eclipse.ini");
        if (ini.isFile()) {
            return new lombok.installer.EclipseLocation(lombok.installer.EclipseLocation.getFilePath(exePath), ini);
        }
    }
    {
        if (loopCounter < 50) {
            try {
                java.lang.String oPath = exePath.getAbsolutePath();
                java.lang.String nPath = exePath.getCanonicalPath();
                if (!oPath.equals(nPath)) {
                    try {
                        return lombok.installer.EclipseLocation.findEclipseIniFromExe(new java.io.File(nPath), loopCounter + 1);
                    } catch (lombok.installer.EclipseLocation.NotAnEclipseException ignore) {
                        // Unlinking didn't help find an eclipse, so continue.
                    }
                }
            } catch (java.io.IOException ignore) {
                /* okay, that didn't work, assume it isn't a soft link then. */
            }
        }
    }
    {
        java.lang.String path = exePath.getAbsolutePath();
        try {
            path = exePath.getCanonicalPath();
        } catch (java.io.IOException ignore) {
            /* We'll stick with getAbsolutePath()'s result then. */
        }
        if ((path.equals("/usr/bin/eclipse") || path.equals("/bin/eclipse")) || path.equals("/usr/local/bin/eclipse")) {
            java.io.File ini = new java.io.File("/usr/lib/eclipse/eclipse.ini");
            if (ini.isFile()) {
                return new lombok.installer.EclipseLocation(path, ini);
            }
            ini = new java.io.File("/usr/local/lib/eclipse/eclipse.ini");
            if (ini.isFile()) {
                return new lombok.installer.EclipseLocation(path, ini);
            }
            ini = new java.io.File("/usr/local/etc/eclipse/eclipse.ini");
            if (ini.isFile()) {
                return new lombok.installer.EclipseLocation(path, ini);
            }
            ini = new java.io.File("/etc/eclipse.ini");
            if (ini.isFile()) {
                return new lombok.installer.EclipseLocation(path, ini);
            }
        }
    }
    /* If we get this far, we lose. */
    throw new lombok.installer.EclipseLocation.NotAnEclipseException("This path does not appear to contain an eclipse installation: " + exePath, null);
}

