/**
 * Checks if there is a method with the provided name. In case of multiple methods (overloading), only
 * the first method decides if EXISTS_BY_USER or EXISTS_BY_LOMBOK is returned.
 *
 * @param methodName
 * 		the method name to check for.
 * @param node
 * 		Any node that represents the Type (JCClassDecl) to look in, or any child node thereof.
 */
public static lombok.javac.handlers.JavacHandlerUtil.MemberExistsResult methodExists(java.lang.String methodName, lombok.javac.JavacNode node) {
    while ((node != null) && (!(node.get() instanceof com.sun.tools.javac.tree.JCTree.JCClassDecl))) {
        node = node.up();
    } 
    if ((node != null) && (node.get() instanceof com.sun.tools.javac.tree.JCTree.JCClassDecl)) {
        for (com.sun.tools.javac.tree.JCTree def : ((com.sun.tools.javac.tree.JCTree.JCClassDecl) (node.get())).defs) {
            if (def instanceof com.sun.tools.javac.tree.JCTree.JCMethodDecl) {
                if (((com.sun.tools.javac.tree.JCTree.JCMethodDecl) (def)).name.contentEquals(methodName)) {
                    lombok.javac.JavacNode existing = node.getNodeFor(def);
                    if ((existing == null) || (!existing.isHandled())) {
                        return lombok.javac.handlers.JavacHandlerUtil.MemberExistsResult.EXISTS_BY_USER;
                    }
                    return lombok.javac.handlers.JavacHandlerUtil.MemberExistsResult.EXISTS_BY_LOMBOK;
                }
            }
        }
    }
    return lombok.javac.handlers.JavacHandlerUtil.MemberExistsResult.NOT_EXISTS;
}

