                    if (!altName.equals(methodName)) {
                        altNameExpl = java.lang.String.format(" (%s)", altName);
                    }
                    errorNode.addWarning(java.lang.String.format("Not generating %s(): A method with that name already exists%s", methodName, altNameExpl));
