private boolean replaceStatementInCollection(java.lang.reflect.Field field, java.lang.Object fieldRef, java.util.List<java.util.Collection<? extends java.lang.Object>> chain, java.util.Collection<? extends java.lang.Object> collection, N oldN, N newN) throws java.lang.IllegalAccessException {
    if (collection == null) {
        return false;
    }
    int idx = -1;
    for (java.lang.Object o : collection) {
        idx++;
        if (o == null) {
            continue;
        }
        if (java.util.Collection.class.isInstance(o)) {
            java.util.Collection<? extends java.lang.Object> newC = ((java.util.Collection<? extends java.lang.Object>) (o));
            java.util.List<java.util.Collection<? extends java.lang.Object>> newChain = new java.util.ArrayList<java.util.Collection<? extends java.lang.Object>>(chain);
            newChain.add(newC);
            if (this.replaceStatementInCollection(field, fieldRef, newChain, newC, oldN, newN)) {
                return true;
            }
        }
        if (o == oldN) {
            this.setElementInASTCollection(field, fieldRef, chain, collection, idx, newN);
            return true;
        }
    }
    return false;
}

