@java.lang.SuppressWarnings("unchecked")
public static java.lang.Class<? extends java.lang.annotation.Annotation> findAnnotationClass(java.lang.Class<? extends java.lang.Object> c, java.lang.Class<? extends java.lang.Object> base) {
