private static void readServicesFromUrl(java.util.Collection<java.lang.String> list, java.net.URL url) throws java.io.IOException {
    java.io.InputStream in = url.openStream();
    try {
        if (in == null) {
            return;
        }
        java.io.BufferedReader r = new java.io.BufferedReader(new java.io.InputStreamReader(in, "UTF-8"));
        while (true) {
            java.lang.String line = r.readLine();
            if (line == null) {
                break;
            }
            int idx = line.indexOf('#');
            if (idx != (-1)) {
                line = line.substring(0, idx);
            }
            line = line.trim();
            if (line.length() == 0) {
                continue;
            }
            list.add(line);
        } 
    } finally {
        try {
            if (in != null) {
                in.close();
            }
        } catch (java.lang.Throwable ignore) {
        }
    }
}

