/**
 * Given a list of field names and a node referring to a type, finds each name in the list that does not match a field within the type.
 */
public static java.util.List<java.lang.Integer> createListOfNonExistentFields(java.util.List<java.lang.String> list, lombok.eclipse.EclipseNode type, boolean excludeStandard, boolean excludeTransient) {
    boolean[] matched = new boolean[list.size()];
    for (lombok.eclipse.EclipseNode child : type.down()) {
        if (list.isEmpty()) {
            break;
        }
        if (child.getKind() != lombok.core.AST.Kind.FIELD) {
            continue;
        }
        if (excludeStandard) {
            if ((((org.eclipse.jdt.internal.compiler.ast.FieldDeclaration) (child.get())).modifiers & org.eclipse.jdt.internal.compiler.classfmt.ClassFileConstants.AccStatic) != 0) {
                continue;
            }
            if (child.getName().startsWith("$")) {
                continue;
            }
        }
        if (excludeTransient && ((((org.eclipse.jdt.internal.compiler.ast.FieldDeclaration) (child.get())).modifiers & org.eclipse.jdt.internal.compiler.classfmt.ClassFileConstants.AccTransient) != 0)) {
            continue;
        }
        int idx = list.indexOf(child.getName());
        if (idx > (-1)) {
            matched[idx] = true;
        }
    }
    java.util.List<java.lang.Integer> problematic = new java.util.ArrayList<java.lang.Integer>();
    for (int i = 0; i < list.size(); i++) {
        if (!matched[i]) {
            problematic.add(i);
        }
    }
    return problematic;
}
